    const [show,setshow] =useState('');
    const Navigate= useNavigate();
    
    const callHomePage = async () => {
        try{
            const res= await fetch('/contact', {
                method: "GET" ,
                headers : {
                
                    "Content-Type": "application/json"
                },
                
            });
            const data= await res.json();
            console.log(data);
            setuserName(data);

            if(!res.status === 200){
                const error=new Error(res.error);
                throw error;
            }
        }

        catch (err){
                console.log(err);
                Navigate('/login');
        }
    }

useEffect(() => {
